/* Loop Code */

/* Big thanks to @rico4dev for providing the base start for ATR calcs
I made some tweaks so now the way ATR is calculated matches TradingView :-)
 */

// Set parameters to be used for ATR Period and Multiplier
let Nperiod = 10 // ATR Period
let multiplier = 3 // ATR Multiplier

// Get Current and Previous Candle Data
let currCandle = record.current 
let prevCandle = record.previous 

/* We need to build the price source
For current price there is no problem, we have data
For previous price we must check if exist
Source price is defined as OHCL4*/

// OHCL4 Source for current price
variable.currClose = currCandle.close
variable.ohcl4 = (currCandle.max + currCandle.min + currCandle.close + currCandle.open)/4

// OHCL4 Source for previous candle price - make sure data exists
if (prevCandle === undefined) {
    variable.prevClose = currCandle.close
    variable.prev_ohcl4 = 0    
} else {
    variable.prevClose = prevCandle.close
    variable.prev_ohcl4 = (prevCandle.max + prevCandle.min + prevCandle.close + prevCandle.open)/4
}

/* Define variables we need and build functions */
/* True Range and ATR - Average True Range */

variable.trueRange = calculateTR()
variable.atrNPeriod = calculateATR(Nperiod)
variable.prevAtrNperiod = variable.atrNPeriod // Store ATR value for calcs in RMA

/* To keep lastNperiodTR array to a fixed length
we remove the first element of the array if length is > Nperiod */

variable.lastNPeriodTR.push(calculateTR())
if (variable.lastNPeriodTR.length > Nperiod) {
    variable.lastNPeriodTR.splice(0, 1)
}

/* Calculate ATR */
function calculateATR(length) {
    return calculateRMA(variable.trueRange, length)
}

/* Calculate True Range */
function calculateTR() {
    let hl = currCandle.max - currCandle.min    
    if (variable.prevClose === 0) { return hl } // Return High-Low when previous Close is 0    
    let hcp = Math.abs(currCandle.max - variable.prevClose)
    let lcp = Math.abs(currCandle.min - variable.prevClose)    
    return Math.max(hl, hcp, lcp)
}

/* Calculate RMA */
function calculateRMA(src, length) {    
    if (src.length < length) { return 0 } // We check we have enough values to make the calcs. If not, set value to zero 
    let alpha=1/length // It's a constant
    if (isNaN(variable.prevAtrNperiod)) {
        return 0    
    } else {
        return alpha * src + (1 - alpha) * variable.prevAtrNperiod            
    }  

}

// Build Up Trend function

variable.up = variable.ohcl4 - (multiplier * variable.atrNPeriod)

if (variable.last2uptrend.length > 2) {
    variable.last2uptrend.splice(0, 1)
}

variable.up1 = variable.last2uptrend[variable.last2uptrend.length - 1] // Previous Up Trend 

variable.uptrend = calculateUpTrend()

variable.last2uptrend.push(variable.uptrend) 

function calculateUpTrend() {
    if (variable.prevClose > variable.up1) {
        return Math.max(variable.up, variable.up1)
    } else {
        return variable.up
    }
}

// Build Down Trend function

variable.dn = variable.ohcl4 + (multiplier * variable.atrNPeriod)

if (variable.last2downtrend.length > 2) {
    variable.last2downtrend.splice(0, 1)
}

variable.dn1 = variable.last2downtrend[variable.last2downtrend.length - 1] // Previous Down Trend

variable.downtrend = calculateDnTrend()

variable.last2downtrend.push(variable.downtrend) 

function calculateDnTrend() {
    if (variable.prevClose < variable.dn1) {
        return Math.min(variable.dn, variable.dn1)
    } else {
        return variable.dn
    }
}


// Build Trend function

if (variable.last2Trend.length > 2) {
    variable.last2Trend.splice(0, 1)
}

variable.prevTrend = variable.last2Trend[variable.last2Trend.length - 1]

variable.trend = calculateTrend()

variable.last2Trend.push(variable.trend)

function calculateTrend() {

    if (variable.trend = -1 && variable.currClose > variable.dn1) {
        return 1
    }
    else if (variable.trend = 1 && variable.currClose < variable.up1) {
        return -1
    }    
    else {
        return variable.prevTrend
    }
}

// End of code :-)

/* Initialization Code*/

//// Arrays to store past data
variable.lastNPeriodTR = []
variable.last2uptrend = [0]
variable.last2downtrend = [0]
variable.last2Trend = [0]

// Initialize trend
variable.trend = 1

/* Loop Code */

let candle = {
    open: record.current.open,
    close: record.current.close,
    min: record.current.min,
    max: record.current.max,
    begin: record.current.begin,
    end: record.current.end,
} 

/* Set constant */

let n1=10 // Channel Length
let n2=21 // Average Length

// Overbought and Oversold Levels
let ob=60
let ob2=53
let os=-60
let os2=-53

/* ************** */

variable.ap = (candle.max+candle.min+candle.close)/3

/* Build 3 EMAs and CI parameter */

variable.EMAesa = calculateEMA(variable.ap, n1, variable.previousEMAesa)
if (isNaN(variable.EMAesa)) {variable.EMAesa=0}
variable.previousEMAesa = variable.EMAesa

variable.EMAd = calculateEMA(Math.abs(variable.ap-variable.EMAesa), n1, variable.previousEMAd)
if (isNaN(variable.EMAd)) {variable.EMAd=0}
variable.previousEMAd = variable.EMAd

variable.ci = (variable.ap-variable.EMAesa)/(0.015*variable.EMAd)
if (isNaN(variable.ci)) {variable.ci=0}

variable.EMAtci = calculateEMA(variable.ci, n2, variable.previousEMAtci)
if (isNaN(variable.EMAtci)) {variable.EMAtci=0}
variable.previousEMAtci = variable.EMAtci

function calculateEMA(src, periods, previousEMA) {
    if (src.length < periods) { return 0 }
    let k = 2 / (periods + 1)
    return src * k + previousEMA * (1-k)
}

/* Build WAVETREND and WAVETRENDSIGNAL 
For WAVETRENDSIGNAL we need a SMA
Parameters are SMA(WAVETREND, 4) */

variable.waveTrend = variable.EMAtci // Wave Trend - It's a line

variable.last4wt1.push(variable.waveTrend)
if (variable.last4wt1.length > 4) {
    variable.last4wt1.splice(0, 1) // Remove the first element of the array to keep it at a maximum of 4 elements
}

variable.waveTrendSignal = calculateSMA(variable.last4wt1, 4) // Signal - It's a line

function calculateSMA(src, periods) { 
    // Check we have enough values to make the calculation
    if (src.length < periods) { return 0 }

    let sum = 0 // Initialize sum variable
    for (let i = src.length - periods; i < src.length; i++) {
        sum = sum + src[i]
    }
    let sma = sum / periods
    return sma
}

/* Build WT3 */

variable.wt3 = variable.waveTrend - variable.waveTrendSignal // Histogram

// End of code :-)

/* Initialization Code */
/* WaveTrend needs 3 EMA and 1 SMA
Others constants and vars are declared in the loop code
so to use let and not var and avoid possible conflicts */

variable.previousEMAesa = 0
variable.previousEMAd = 0
variable.previousEMAtci = 0

variable.last4wt1 = [] // Last 4 wt1 records

/* HLC3 */
variable.ap = 0

/* Loop Code */

let dcLen = 20 // Channel length
let candle = record.current

// Build arrays Max and Min

variable.lastHighs.push(candle.max)    
variable.lastLows.push(candle.min)

// Keep the array the correct size

if (variable.lastHighs.length > dcLen) {
    variable.lastHighs.splice(0, 1)
}

if (variable.lastLows.length > dcLen) {
    variable.lastLows.splice(0, 1)
}

// Calculate indicator values

variable.hiHigh = calculateHigh (variable.lastHighs, dcLen) // higher highs
variable.loLow = calculateLow (variable.lastLows, dcLen)  // lower lows
variable.midPoint = (variable.hiHigh + variable.loLow) / 2    // Midpoint

function calculateHigh (array, length) {

    /* We check we have enough values to make the calculation */
    if (array.length < length) { return 0 }

    return Math.max(...array)
}

function calculateLow (array, length) {

    /* We check we have enough values to make the calculation */
    if (array.length < length) { return 0 }

    return Math.min(...array)
}


// End of code :-)

/* Loop Code */

let len = 14 // DI Length
let lensig = 14 // ADX Smoothing

// Get Current and Previous Candle Data
let currCandle = record.current 
let prevCandle = record.previous 


// Make sure data exists for prevCandle
// Build variable.up = current max - previous max

if (prevCandle === undefined) {
    variable.up = 0
    variable.down = 0
    variable.prevClose = currCandle.close
} else {
    variable.up = currCandle.max - prevCandle.max
    variable.down = prevCandle.min - currCandle.min
    variable.prevClose = prevCandle.close
}


// console.log (variable.up, variable.down)


variable.plusDM = calculatePlusDM (variable.up,variable.down)
variable.minusDM = calculateMinusDM (variable.up,variable.down)


function calculatePlusDM (up, down) {
    if (up > down && up > 0) {
        return up
    } else {
        return 0
    }
}

function calculateMinusDM (up, down) {
    if (down > up && down > 0) {
        return down
    } else {
        return 0
    }
}


variable.trueRange = calculateTR()

/* Calculate True Range */
function calculateTR() {
    let hl = currCandle.max - currCandle.min    
    if (variable.prevClose === 0) { return hl }
    if (isNaN(variable.prevClose)) { return hl } // Return High-Low when previous Close is 0    
    let hcp = Math.abs(currCandle.max - variable.prevClose)
    let lcp = Math.abs(currCandle.min - variable.prevClose)    
    return Math.max(hl, hcp, lcp)
}

/* Calculate RMA */
function calculateRMA(src, length, prevRMA) {
    if (src.length < length) { return 0 }
    let alpha = 1/length
    return alpha*src+(1-alpha)*prevRMA
}

variable.trur = calculateRMA(variable.trueRange, len, variable.previousTrur)
variable.previousTrur = variable.trur

k = 100/variable.trur

variable.basePlusDI = calculateRMA(variable.plusDM, len, variable.previousBasePlusDI)
variable.previousBasePlusDI = variable.basePlusDI

variable.baseMinusDI = calculateRMA(variable.minusDM, len, variable.previousBaseMinusDI)
variable.previousBaseMinusDI = variable.baseMinusDI

variable.plusDI = variable.basePlusDI * k
if (isNaN(variable.plusDI)) {variable.plusDI=0}
variable.minusDI = variable.baseMinusDI * k
if (isNaN(variable.minusDI)) {variable.minusDI=0}

variable.sumPlusMinus = variable.plusDI + variable.minusDI

if (variable.sumPlusMinus == 0) {
    variable.sumPlusMinus = 1    
} else {
    variable.sumPlusMinus = variable.sumPlusMinus
}

variable.baseADX = calculateRMA(Math.abs(variable.plusDI - variable.minusDI)/variable.sumPlusMinus, lensig, variable.previousBaseADX)
variable.previousBaseADX = variable.baseADX
variable.adx = 100 * variable.baseADX

// End of code :-)

/* Loop Code */

/* Modify value here */

let conversionPeriods = 20  // Conversion Line Periods
let basePeriods = 30    // Base Line Periods
let laggingSpan2Periods = 120   // Lagging Span 2 Periods
let displacement = 60   // Displacement
let maxCandles = 26	//max candles for lagging line

/* Define candle object and property */

let candle = {
    open: record.current.open,
    close: record.current.close,
    min: record.current.min,
    max: record.current.max,
    begin: record.current.begin,
    end: record.current.end,
} 

/* We need a function to calculate the average
of past (length) Lows and Highs
Basically it is a Donchian
with different periods */

// Build arrays Max and Min for each variable

variable.lastHiConversionPeriods.push(candle.max)
variable.lastHiBasePeriods.push(candle.max)
variable.lastHiLaggingSpan2Periods.push(candle.max)

variable.lastLowConversionPeriods.push(candle.min)
variable.lastLowBasePeriods.push(candle.min)
variable.lastLowLaggingSpan2Periods.push(candle.min)

variable.pastCandles.push(record.current.close)		// add current close to the past candles array for later retrieval

// And keep the array the correct size
// Highs

if (variable.lastHiConversionPeriods.length > conversionPeriods) {
    variable.lastHiConversionPeriods.splice(0, 1)
}

if (variable.lastHiBasePeriods.length > basePeriods) {
    variable.lastHiBasePeriods.splice(0, 1)
}

if (variable.lastHiLaggingSpan2Periods.length > laggingSpan2Periods) {
    variable.lastHiLaggingSpan2Periods.splice(0, 1)
}

// Lows
if (variable.lastLowConversionPeriods.length > conversionPeriods) {
    variable.lastLowConversionPeriods.splice(0, 1)
}

if (variable.lastLowBasePeriods.length > basePeriods) {
    variable.lastLowBasePeriods.splice(0, 1)
}

if (variable.lastLowLaggingSpan2Periods.length > laggingSpan2Periods) {
    variable.lastLowLaggingSpan2Periods.splice(0, 1)
}

// past candles
if (variable.pastCandles.length > maxCandles) {
    variable.pastCandles.splice(0, 1)
}

// Build a donchian function to calculate average of Highs and Lows

function donchian (srcMax, srcMin, length) {

    let hiHigh = calculateHigh (srcMax, length) // higher highs
    let loLow = calculateLow (srcMin, length)  // lower lows
    return (hiHigh + loLow) / 2    // Average
}

function calculateHigh (array, length) {
    /* We check we have enough values to make the calculation */
    if (array.length < length) { return 0 }
    return Math.max(...array)
}

function calculateLow (array, length) {
    /* We check we have enough values to make the calculation */
    if (array.length < length) { return 0 }
    return Math.min(...array)
}

// Build Ichimoku Clouds!

variable.conversionLine = donchian (variable.lastHiConversionPeriods, variable.lastLowConversionPeriods, conversionPeriods)
variable.baseLine = donchian (variable.lastHiBasePeriods, variable.lastLowBasePeriods, basePeriods)
variable.plotLeadLine1 = (variable.conversionLine + variable.baseLine) / 2
variable.plotLeadLine2 = donchian (variable.lastHiLaggingSpan2Periods, variable.lastLowLaggingSpan2Periods, laggingSpan2Periods)

// Lagging Span is the close price plotted back "displacement" periods
if (variable.pastCandles.length >= maxCandles) {
	variable.laggingSpan = variable.pastCandles[0]	// always use the first value in the array
}
else { variable.laggingSpan = 0 }	//return zero if not enough candle history in the array


/* We need to plot data in the past for the LaggingLine
and in the future for LeadLine 1&2
Defining past/forward Begin/End -> Values are then stored as new properties
in Record definition so we can use them in Chart Points to plot
data in the past and in the future
*/

variable.pastBegin = candle.begin - (candle.end-candle.begin)*displacement
variable.pastEnd =  candle.end - (candle.end-candle.begin)*displacement

variable.forwardBegin = candle.begin + (candle.end-candle.begin)*displacement
variable.forwardEnd =  candle.end + (candle.end-candle.begin)*displacement

/* Syncronizing LeadLine 1&2 values with current candle
so when writing strategy values are synced
*/

variable.pastLeadLine1.push(variable.plotLeadLine1)
if (variable.pastLeadLine1.length > displacement) {
    variable.pastLeadLine1.splice(0, 1)
}

if (variable.pastLeadLine1.length < displacement) {
    variable.leadLine1 = 0        
} else {
    variable.leadLine1 = variable.pastLeadLine1[0] // LeadLine1    
}

variable.pastLeadLine2.push(variable.plotLeadLine2)
if (variable.pastLeadLine2.length > displacement) {
    variable.pastLeadLine2.splice(0, 1)
}

if (variable.pastLeadLine2.length < displacement) {
    variable.leadLine2 = 0        
} else {
    variable.leadLine2 = variable.pastLeadLine2[0] // LeadLine2
}

// End of code :-)

